import React from "react";
import {FontAwesomeIcon} from "@fortawesome/react-fontawesome"
import {faSoundcloud, faYoutubeSquare} from "@fortawesome/free-brands-svg-icons";
import {Container, Row, Col} from "react-bootstrap";
import "./logos.scss";

const Logos = React.memo(() => {

    return (
        <section className="homo-logos">
            <Container>
                <Row>
                    <Col xs={12} lg={12}>
                        <div className="logos-container">
                            <FontAwesomeIcon className="icon" icon={faSoundcloud}/>
                            <FontAwesomeIcon className="icon" icon={faYoutubeS}/>
                        </div>
                    </Col>
                </Row>
            </Container>            
        </section>
    )
}, [])

export default Logos;
